import React from 'react';
import Grid from '@material-ui/core/Grid';
import CardTH from './CardTH';

function Serre() {
  return (
    <Grid container spacing={3}>
        <Grid item xs={6}>
            <CardTH typeData="Temperature"/>
        </Grid>
        <Grid item xs={6}>
            <CardTH typeData="Humidite"/>
        </Grid>
    </Grid>
  );
}

export default Serre;
